"Где я могу обменять полученные додокоины?",DODOCOIN_LANDING_QNA_2_A:"Обменять додокоины на продукты можно только в приложении на вкладке «Профиль».",DODOCOIN_LANDING_QNA_3_Q:"Как получить додокоины на кассе в пиццерии?",DODOCOIN_LANDING_QNA_3_A:"Назовите свой номер телефона на кассе, и мы начислим на него додокоины.",DODOCOIN_LANDING_QNA_4_Q:"Какой срок действия у додокоинов?",DODOCOIN_LANDING_QNA_4_A:"Додокоины сгорают через 400 дней с момента начисления. Узнать ближайшую дату и сумму сгорания можно в мобильном приложении во вкладке «Профиль» в разделе «Додокоины».",DODOCOIN_LANDING_QNA_5_Q:"Что такое кешбэк?",DODOCOIN_LANDING_QNA_5_A:"Кешбэк – это возврат додокоинов на специальный счет в приложении. Посмотреть состояние счета можно на вкладке «Профиль». Додокоины – единицы внутренней валюты, которые начисляются за участие в программе лояльности.",DODOCOIN_LANDING_QNA_6_Q:"Как начисляются додокоины?",DODOCOIN_LANDING_QNA_6_A:"Додокоины начисляются в Профиле клиента по формуле: 5% от стоимости заказа * 100. Полученное число мы округляем по правилам математического округления.\nНапример, ваш заказ был на 4,9 белорусских рубля, то 5% от указанной стоимости – это 0,25 Значит мы начислим вам 0,25*100=25 додокоинов.",DODOCOIN_LANDING_QNA_7_Q:"На что я смогу обменять додокоины?",DODOCOIN_LANDING_QNA_7_A:"Додокоины можно обменять на продукты и напитки в «Додо Пицце». Есть пять категорий: напитки, закуски, большие, средние и маленькие пиццы. Точный список продуктов можно узнать в приложении.",DODOCOIN_LANDING_QNA_8_Q:"DODOCOIN_LANDING_QNA_8_Q",DODOCOIN_LANDING_QNA_8_A:"DODOCOIN_LANDING_QNA_8_A",DODOCOIN_LANDING_QNA_9_Q:"DODOCOIN_LANDING_QNA_9_Q",DODOCOIN_LANDING_QNA_9_A:"DODOCOIN_LANDING_QNA_9_A",DODOCOIN_LANDING_QNA_10_Q:"DODOCOIN_LANDING_QNA_10_Q",DODOCOIN_LANDING_QNA_10_A:"DODOCOIN_LANDING_QNA_10_A",DODOCOIN_LANDING_QNA_11_Q:"Что такое миссии?",DODOCOIN_LANDING_QNA_11_A:"Миссии – это задания, которые мы предлагаем вам пройти. За прохождение миссии мы начислим додокоины. Миссии могут быть для одного, двоих или целой компании.",DODOCOIN_LANDING_QNA_12_Q:"Кто будет проверять выполнение миссий?",DODOCOIN_LANDING_QNA_12_A:"Ответы на каждую миссию смотрит модератор. Модератор проверяет выполнение всех условий из задания и начисляет додокоины. Додокоины за прохождение миссии поступят на счет в течение 24 часов. Если в миссии были выполнены не все условия, то коины за задание начислить не сможем.",DODOCOIN_LANDING_LEGAL_URL:"https://docs.google.com/document/d/1weITNKBHXIXI_1fgw5xu2auV1s0VpODdcVVyDJhzxZA",DODOCOIN_LANDING_LEGAL_TEXT:"Полные правила программы",DODOCOIN_LANDING_FOOTER_TITLE:"Ура, вы всё\nпрочитали!",DODOCOIN_LANDING_FOOTER_DESC:"Осталось скачать приложение",DODOCOIN_LANDING_FOOTER_QR_HELP:"Наведите камеру\nи скачивайте приложение",TIPS_TITLE:"Чаевые курьеру",TIPS_DESC:"Курьер Додо Пиццы получит вашу благодарность",CURRENT_ORDER_WIDGET_TIPS_1:"Понравилось?",CURRENT_ORDER_WIDGET_TIPS_2:"Оставьте чаевые курьеру",MIN_ORDER_AMOUNT:"До минимальной суммы на доставку —",HOW_TO_GET_ORDER_TITLE:"Какой у вас адрес?",HOW_TO_GET_ORDER_DESCRIPTION:"Хотим убедиться, что вы в зоне доставки. Адрес сохраним для будущих заказов.",HOW_TO_GET_ORDER_DELIVERY_ACTION:"Указать адрес доставки",HOW_TO_GET_ORDER_PICKUP_ACTION:"Забрать из пиццерии",HOW_TO_GET_ORDER_LOGIN_DESCRIPTION:"Уже есть аккаунт?",HOW_TO_GET_ORDER_LOGIN_ACTION:"Войти",DELIVERY_FEE_TOOLTIP:"Эта цена помогает нам доставлять наши горячие и вкусные пиццы очень быстро",COUNTRY_LABEL:"Страна",SEARCH_BY_COUNTRY:"Поиск по стране",COUNTRY_NAME_AF:"Afghanistan",COUNTRY_NAME_AX:"Aland Islands",COUNTRY_NAME_AL:"Albania",COUNTRY_NAME_DZ:"Algeria",COUNTRY_NAME_AS:"American Samoa",COUNTRY_NAME_AD:"Andorra",COUNTRY_NAME_AO:"Angola",COUNTRY_NAME_AI:"Anguilla",COUNTRY_NAME_AQ:"Antarctica",COUNTRY_NAME_AG:"Antigua and Barbuda",COUNTRY_NAME_AR:"Argentina",COUNTRY_NAME_AM:"Armenia",COUNTRY_NAME_AW:"Aruba",COUNTRY_NAME_AC:"Ascension Island",COUNTRY_NAME_AU:"Australia",COUNTRY_NAME_AT:"Austria",COUNTRY_N